package pattern;

public class PrintNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
    
		
		for(int row=1; row<=3; row++)
		{
			for(int col=1; col<=3; col++)
			{
				System.out.print(row+col);
			}
			System.out.println();
		}
		
	}
	
}
